  [],\n\t\"num_tags\": 0,\n\t\"name\": \"temperature-profiles-from-xbt-casts-from-the-american-argo-as-part-of-the-marine-resources-monie7e6b\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Temperature profiles were collected from
  XBT casts from the AMERICAN ARGO from 31 August 1978. Data were collected by Moore-McCormack
  Lines Inc. as part of the Marine Resources Monitoring, Assessment and Prediction
  (MARMAP) project. Data were processed by NODC to the NODC standard Universal Bathythermograph
  Output (UBT) format. Full format description is available from NODC at www.nodc.noaa.gov/General/NODC-Archive/bt.html.nnThe
  UBT format contains temperature-depth profile data obtained using expendable bathythermograph
  (XBT) instruments. Cruise information, position, date and time were reported for
  each observation. The data records are comprised of pairs of temperature-depth values.
  The XBT data files contain temperature values at non-uniform depths. These depths
  were recorded at the minimum number of points (\"inflection points\") required to
  accurately define the temperature curve. Standard XBTs can obtain profiles to depths
  of either 450 or 760 m. Special instruments permitted measurements to be obtained
  to 1830 m.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
